script: |
  super -f text -I q191.spq | sort > q191.out

inputs:
  - name: q191.spq
    data: |
      SELECT ALL - + ( col1 ) - col0 / + 24 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT NULL NOT BETWEEN CAST ( - - 3 AS INTEGER ) + + col2 AND NULL;
  - name: tab1

outputs:
  - name: q191.out
    data: |
